import logo from './logo.svg';

import React from 'react';
import './App.css';
import UserList from './UserList';

function App() {
  const users = [
    {
        id:1,
        username:'likelion1',
        email:'likelion1@gmail.com'
    },
    {
        id:2,
        username:'likelion2',
        email:'likelion3@gmail.com'
    },
    {
        id:3,
        username:'likelion3',
       email:'likelion3@gmail.com'
    }
  ];

  return <UserList users={users} />;
}

export default App;
